namespace Sharepoint.Http.Data.Connector.UT
{
    [TestClass]
    public class UnitTest
    {
        SharepointDataContext _sharepointContext = default(SharepointDataContext);

        [TestInitialize]
        public void TestInicialize()
        {
            _sharepointContext = new SharepointDataContext(new SharepointContextConfiguration
            {
                // Authentication for sharepoint configuration.
                AuthenticationUrl = "",
                TenantId = "",
                ClientId = "",
                ClientSecret ="",
                GrantType = "",
                Resource = "",
                // Rest API to sharepoint site configuration.
                SharepointSiteId = "",
                SharepointSiteName = "",
                SharepointInstanceUrl = "",
                SharepointSiteUrl = "",
                ServerRelativeUrl = ""
            });
        }

        [TestMethod]
        public async Task Exists_Folder_In_Site()
        {
            var response = await _sharepointContext.ExistsFolderAsync("010012827");
            if (!response)
                throw new Exception("The folder exists, response is wrong!!");
        }

        [TestMethod]
        public async Task Does_Not_Exist_Folder_In_Site()
        {
            var response = await _sharepointContext.ExistsFolderAsync("010012820");
            if (response)
                throw new Exception("The folder doesn't exists, response is wrong!!");
        }

        [TestMethod]
        public async Task Exists_File_In_Site()
        {
            var response = await _sharepointContext.ExistsFileAsync("010012827", "CURP.pdf");
            if (!response)
                throw new Exception("The file exists, response is wrong!!");
        }

        [TestMethod]
        public async Task Does_Not_Exists_File_In_Site()
        {
            var response = await _sharepointContext.ExistsFileAsync("010012827", "Document.pdf");
            if (response)
                throw new Exception("The file doesn't exists, response is wrong!!");
        }

        [TestMethod]
        public async Task Success_Delete_Resource()
        {
            var response = await _sharepointContext.DeleteResourceAsync("TestFolder");
            if (!response)
                throw new Exception("The resource must be deleted!!");
        }

        [TestMethod]
        public async Task Success_Delete_File()
        {
            var response = await _sharepointContext.DeleteFileAsync("020044413", "TestDocument.pdf");
            if (!response)
                throw new Exception("The resource must be deleted!!");
        }

        [TestMethod]
        public async Task Success_Download_File()
        {
            var response = await _sharepointContext.DownloadFileAsync("020044412", "TestDocument.pdf");
            if (response.Length <= 0)
                throw new Exception("The resource must be downloaded, it exists!!");
        }

        [TestMethod]
        public async Task Success_Folder_Creation_In_Main_Relative_URL()
        {
            var response = await _sharepointContext.CreateFolderAsync("My folder");
            if (response is null)
                throw new Exception("The resource must be created on main server relative url!!");
        }

        [TestMethod]
        public async Task Success_Folder_Creation_In_Custom_Relative_URL()
        {
            var response = await _sharepointContext.CreateFolderAsync("My folder", "My new folder");
            if (response is null)
                throw new Exception("The resource must be created on main server relative url!!");
        }

        [TestMethod]
        public async Task Success_Upload_Document()
        {
            var content = Convert.FromBase64String("");
            var response = await _sharepointContext.UploadFileAsync("My folder/My new folder", "DocumentTest2.pdf", content);
            if (response is null)
                throw new Exception("The resource must be updated!!");
        }
    }
}